import React from "react";
import "./CategorySection.css"; // optional CSS file for styling

const categories = [
  { title: "Medicines", img: "/images/medicines.png" },
  { title: "Personal Care", img: "/images/personalcare.png" },
  { title: "Healthcare", img: "/images/healthcare.png" },
  { title: "Beauty", img: "/images/beauty.png" },
  { title: "Health Vlogs", img: "/images/healthvlogs.png" },
  { title: "Ayurveda", img: "/images/ayurveda.png" },
];

function CategorySection() {
  return (
    <section className="category-section py-4">
      <div className="container text-center">
        <div className="d-flex flex-wrap justify-content-center gap-4">
          {categories.map((cat, index) => (
            <div key={index} className="category-card text-center">
              <img
                src={cat.img}
                alt={cat.title}
                className="category-img mb-2"
              />
              <h6 className="fw-bold">{cat.title}</h6>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}

export default CategorySection;
